import React, { Component } from 'react'

import '../../../src/styles.css'

import { StyledContainer, HeaderContainer, MenuBar } from './styled'

export default class Menu extends Component {
  render() {
    const tabs = ['Products', 'Inspirations', 'Shop']

    return (
      <StyledContainer>
        <HeaderContainer>
          <MenuBar flex={false} row style={styles.tabs}>
            {tabs.map(tab => this.renderTab(tab))}
          </MenuBar>
        </HeaderContainer>
      </StyledContainer>
    )
  }
}
